import React from 'react'

const Header = ({ text }) => {
  return (
    <h1>{text}</h1>
  )
}

const Parts = ({ parts }) => {

  const returnParts = (part) => {
    console.log('Part:', part)
    return <p key={part.id}>{part.name} {part.exercises}</p>
  }

  return (
    <>
      {parts.map(returnParts)}
    </>
  )
}

const Total = ({ parts }) => {

  const calculateTotal = (part) => {
    console.log('Total toimii')
  }

  return (
    <strong>Total of {parts.map(calculateTotal)} exercises</strong>
  )
}

const Content = ({ course }) => {  
  return (
    <>
      <Parts parts={course.parts} key={course.id} />
      <Total parts={course.parts} />
    </>
  )
}

const Course = ({ course }) => {
  console.log('Course:', course)
  return (
    <>
      <Header text={course.name}/>
      <Content course={course} />
    </>
  )
}

export default Course
